Ms. ownership inscription: &quot;Tho[mas] Johnson Magd.&quot;
I think the inscription belongs to Thomas Johnson (d. 1737), an English cleric and academic and a moralist writer. Johnson was a Fellow of Magdalene College, Cambridge (B.A. 1724, M.A. 1728), he was senior university taxor in 1732; and later chaplain at Whitehall Palace. 

