Place of publication (&quot;Basileae&quot;) crossed over with ink.
The early reader of the Penn copy of the Epigrams, probably a Roman Catholic, did not like the mention of the name &quot;Basle&quot;, evidently felt to represent a stronghold of Protestant printing and expunged it on the title page and in the colophon of the book.

